import {React, useState} from "react";
import {
  DivFormSecurePlace,
  FormFormSecurePlace,
  TextFieldFormSecurePlace,
  ButtonFormSecurePlace,
} from "./FormSecurePlaceStyles";

export default function FormSecurePlace() {
    const [form, setForm] = useState({
        name:"",
        description:"",
        state:"",
        street:"",
        suburb:"",
        number:"",
    })

    const handleSubmit=(e)=>{
        e.preventDefault()
        console.log(form)
    }

    const handleChange=(e)=>{
        const nameInput = e.target.name
        const valueInput = e.target.value

        const internalForm = form
        internalForm[nameInput]=valueInput
        setForm(internalForm)
    }

  return (
    <DivFormSecurePlace>
      <FormFormSecurePlace onSubmit={handleSubmit}>
        <h1>Lugares Seguros</h1>
        <TextFieldFormSecurePlace
          id="outlined-basic"
          label="Nombre"
          name="name"
          variant="outlined"
          onChange={handleChange}
        />
        <TextFieldFormSecurePlace
          id="outlined-basic"
          label="Descripcion"
          name="description"
          variant="outlined"
          onChange={handleChange}
        />
        <ButtonFormSecurePlace type="submit" variant="contained">Enviar</ButtonFormSecurePlace>
      </FormFormSecurePlace>
    </DivFormSecurePlace>
  );
}
